SELECT TPCDS.WEB_RETURNS.WR_RETURNED_DATE_SK , TPCDS.WEB_SALES.WS_NET_PROFIT , TPCDS.WEB_SALES.WS_EXT_SALES_PRICE , TPCDS.WEB_SALES.WS_EXT_WHOLESALE_COST , TPCDS.WEB_SALES.WS_WHOLESALE_COST FROM TPCDS.WEB_RETURNS INNER JOIN TPCDS.WEB_SALES ON TPCDS.WEB_SALES.WS_BILL_ADDR_SK = TPCDS.WEB_RETURNS.WR_REFUNDED_ADDR_SK INNER JOIN TPCDS.WEB_SALES ALIAS1 ON ALIAS1.WS_BILL_HDEMO_SK = TPCDS.WEB_RETURNS.WR_REFUNDED_HDEMO_SK INNER JOIN TPCDS.WEB_SALES ALIAS2 ON ALIAS2.WS_ORDER_NUMBER = TPCDS.WEB_RETURNS.WR_ORDER_NUMBER INNER JOIN TPCDS.WEB_SALES ALIAS3 ON ALIAS3.WS_ORDER_NUMBER = TPCDS.WEB_RETURNS.WR_ORDER_NUMBER AND ALIAS3.WS_BILL_HDEMO_SK = TPCDS.WEB_RETURNS.WR_REFUNDED_HDEMO_SK AND ALIAS3.WS_BILL_ADDR_SK = TPCDS.WEB_RETURNS.WR_REFUNDED_ADDR_SK WHERE +25665.23 >= TPCDS.WEB_SALES.WS_EXT_DISCOUNT_AMT AND TPCDS.WEB_RETURNS.WR_RETURNED_TIME_SK >= 32822 AND TPCDS.WEB_SALES.WS_LIST_PRICE = +00051.39 AND TPCDS.WEB_RETURNS.WR_ITEM_SK >= 10705 AND TPCDS.WEB_SALES.WS_WHOLESALE_COST <= +00061.06

