SELECT TPCDS.WEB_SITE.WEB_TAX_PERCENTAGE , TPCDS.DATE_DIM2.D_MONTH_SEQ , TPCDS.CUSTOMER.C_BIRTH_MONTH FROM TPCDS.WEB_SITE INNER JOIN TPCDS.DATE_DIM2 ON TPCDS.DATE_DIM2.D_DATE_SK = TPCDS.WEB_SITE.WEB_CLOSE_DATE_SK INNER JOIN TPCDS.CUSTOMER ON TPCDS.CUSTOMER.C_FIRST_SHIPTO_DATE_SK = TPCDS.DATE_DIM2.D_DATE_SK WHERE TPCDS.DATE_DIM2.D_QOY <= 2 AND 18413 = TPCDS.CUSTOMER.C_CURRENT_ADDR_SK AND 2430330 >= TPCDS.DATE_DIM2.D_SAME_DAY_LY

SELECT TPCDS.WEB_PAGE.WP_WEB_PAGE_SK , TPCDS.CUSTOMER.C_BIRTH_MONTH , TPCDS.STORE_SALES.SS_NET_PROFIT FROM TPCDS.WEB_PAGE INNER JOIN TPCDS.CUSTOMER ON TPCDS.CUSTOMER.C_CUSTOMER_SK = TPCDS.WEB_PAGE.WP_CUSTOMER_SK INNER JOIN TPCDS.STORE_SALES ON TPCDS.STORE_SALES.SS_CUSTOMER_SK = TPCDS.CUSTOMER.C_CUSTOMER_SK WHERE 6874 <= TPCDS.STORE_SALES.SS_HDEMO_SK AND TPCDS.WEB_PAGE.WP_WEB_PAGE_SK >= 44 AND +00780.06 <= TPCDS.STORE_SALES.SS_EXT_DISCOUNT_AMT

SELECT TPCDS.WEB_PAGE.WP_CHAR_COUNT , TPCDS.DATE_DIM.D_FY_YEAR , TPCDS.CATALOG_SALES.CS_EXT_WHOLESALE_COST FROM TPCDS.WEB_PAGE INNER JOIN TPCDS.DATE_DIM ON TPCDS.DATE_DIM.D_DATE_SK = TPCDS.WEB_PAGE.WP_CREATION_DATE_SK INNER JOIN TPCDS.CATALOG_SALES ON TPCDS.CATALOG_SALES.CS_SOLD_DATE_SK = TPCDS.DATE_DIM.D_DATE_SK WHERE TPCDS.CATALOG_SALES.CS_WAREHOUSE_SK >= 4 AND 2099 <= TPCDS.DATE_DIM.D_FY_YEAR AND -00182.92 >= TPCDS.CATALOG_SALES.CS_NET_PROFIT

SELECT TPCDS.CATALOG_SALES.CS_WAREHOUSE_SK , TPCDS.CUSTOMER_DEMOGRAPHICS.CD_DEMO_SK2 FROM TPCDS.CATALOG_SALES INNER JOIN TPCDS.CUSTOMER_DEMOGRAPHICS ON TPCDS.CUSTOMER_DEMOGRAPHICS.CD_DEMO_SK = TPCDS.CATALOG_SALES.CS_BILL_CDEMO_SK AND TPCDS.CUSTOMER_DEMOGRAPHICS.CD_DEMO_SK2 = TPCDS.CATALOG_SALES.CS_SHIP_CDEMO_SK WHERE -00431.90 = TPCDS.CATALOG_SALES.CS_NET_PROFIT AND TPCDS.CATALOG_SALES.CS_EXT_TAX = +00000.72

SELECT TPCDS.CUSTOMER_ADDRESS.CA_GMT_OFFSET , TPCDS.CUSTOMER.C_BIRTH_MONTH FROM TPCDS.CUSTOMER_ADDRESS INNER JOIN TPCDS.CUSTOMER ON TPCDS.CUSTOMER.C_CURRENT_ADDR_SK = TPCDS.CUSTOMER_ADDRESS.CA_ADDRESS_SK WHERE TPCDS.CUSTOMER_ADDRESS.CA_ADDRESS_SK2 <= 142 AND TPCDS.CUSTOMER.C_CURRENT_CDEMO_SK >= 241274
